NodeJs exec function optional callback parameter #4141 
## Update demand :

callback args is called when process terminates, is possible to use events child.stdout.on to receive data before end of process.

callback? must be optional in exec function.

``` js
export function exec(command: string, options: {
        cwd?: string;
        stdio?: any;
        customFds?: any;
        env?: any;
        encoding?: string;
        timeout?: number;
        maxBuffer?: number;
        killSignal?: string;
    }, callback?: (error: Error, stdout: Buffer, stderr: Buffer) =>void ): ChildProcess;

    export function exec(command: string, callback?: (error: Error, stdout: Buffer, stderr: Buffer) =>void ): ChildProcess;

```
## Use case :

``` js

var exec = child_process.exec;
var child = exec('node -v');

child.stdout.on('data', function (data) {
         console.log('node -v', date, { value: data });
});

child.on('close', function (code) {
         console.log('closing code: ' + code);
});

```

Adds support for optionally aliasing jQuery in `$(callback)` and `$(document).ready(callback)`.

See [the jQuery API](http://api.jquery.com/jQuery/#jQuery-callback) for usage.

``` javascript
jQuery(function( $ ) {
  // Your code using failsafe $ alias here...
});
/* analogous */
jQuery(document).ready(function( $ ) {
  // Your code using failsafe $ alias here...
});
```

